import React, { useState } from 'react';
import { Button } from "./ui/button";
import axios from 'axios';

const API_URL = 'http://localhost:3000/api';

const CertificateForm = ({ onSubmitSuccess, editData = null }) => {
  const [formData, setFormData] = useState({
    type: editData?.type || 'Ship Register Certificate',
    issuer: editData?.issuer || '',
    at_location: editData?.at_location || '',
    on_date: editData?.on_date || '',
    last_annual: editData?.last_annual || '',
    expiry_date: editData?.expiry_date || '',
    status: editData?.status || 'Valid',
    certificate_no: editData?.certificate_no || ''
  });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      if (editData) {
        await axios.put(`${API_URL}/certificates/${editData.id}`, formData);
      } else {
        await axios.post(`${API_URL}/certificates`, formData);
      }
      onSubmitSuccess();
    } catch (error) {
      console.error('Error submitting form:', error);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  return (
    <form onSubmit={handleSubmit} className="space-y-4 p-4">
      <div className="grid grid-cols-2 gap-4">
        <div>
          <label className="block text-sm font-medium mb-1">Type</label>
          <input
            type="text"
            name="type"
            value={formData.type}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          />
        </div>
        <div>
          <label className="block text-sm font-medium mb-1">Issuer</label>
          <input
            type="text"
            name="issuer"
            value={formData.issuer}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          />
        </div>
        <div>
          <label className="block text-sm font-medium mb-1">At Location</label>
          <input
            type="text"
            name="at_location"
            value={formData.at_location}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          />
        </div>
        <div>
          <label className="block text-sm font-medium mb-1">On Date</label>
          <input
            type="date"
            name="on_date"
            value={formData.on_date}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          />
        </div>
        <div>
          <label className="block text-sm font-medium mb-1">Last Annual</label>
          <input
            type="date"
            name="last_annual"
            value={formData.last_annual}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          />
        </div>
        <div>
          <label className="block text-sm font-medium mb-1">Expiry Date</label>
          <input
            type="date"
            name="expiry_date"
            value={formData.expiry_date}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          />
        </div>
        <div>
          <label className="block text-sm font-medium mb-1">Status</label>
          <select
            name="status"
            value={formData.status}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          >
            <option value="Valid">Valid</option>
            <option value="Expired">Expired</option>
            <option value="Pending">Pending</option>
          </select>
        </div>
        <div>
          <label className="block text-sm font-medium mb-1">Certificate No</label>
          <input
            type="text"
            name="certificate_no"
            value={formData.certificate_no}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          />
        </div>
      </div>
      <div className="flex justify-end space-x-2">
        <Button variant="outline" type="button" onClick={onSubmitSuccess}>
          Cancel
        </Button>
        <Button type="submit">
          {editData ? 'Update Certificate' : 'Add Certificate'}
        </Button>
      </div>
    </form>
  );
};

export default CertificateForm;
